import React from "react";
import Nav from "./Nav";
import Row from "./Row";
import Notification from "./Notification";
import { useLocation } from "react-router-dom";


function StuHome() {
    const location = useLocation();
    const data = location.state;
    function handleNotify(single){
        if(single.response=="None"){
            return(<Notification message = {single.message}/>)
        }
    }
    function notifyCheck(){
        const notifications = data.notifications;
        console.log(notifications);
        notifications.map(handleNotify);
    }
    notifyCheck();

    return (
    <div>
        <Nav 
            state={data}
        />
        <Row 
            h1 = "Nature Lovers' Club"
            sub1 = "Time: 9:00 AM to 5:00PM"
            src1 = "./pic1.png"
            h2 = "Innovators Quest"
            sub2 = "Time: 7:00 PM"
            src2 = "./pic2.png"
        />
        <Notification message = "Hello"/>
        <div class="toast" role="alert" aria-live="assertive" aria-atomic="true">
        <div class="toast-body">
            Hey there
            <div class="mt-2 pt-2 border-top">
            <button type="button" class="btn btn-primary btn-sm">Got it!</button>
            <button type="button" class="btn btn-secondary btn-sm" data-bs-dismiss="toast">Remind Me Later</button>
            </div>
        </div>
        </div>

        {/* <Row /> */}
    </div>)
}

export default StuHome;
